    --rct-zoom-tracker-fill: #0044ff30;
    /** series navigator */
    --rct-navigator-handle-color: #0098ff; 
    --rct-navigator-handle-hover-color: #55c;
    --rct-navigator-track-fill: lightgray;
    --rct-navigator-thumb-fill:#0098ff;
