/** series */
.rct-series {
    opacity: inherit;
    transition-property: opacity;
    transition-duration: 0.7s;
}
.rct-series[data-unfocus] {
    opacity: 0.2 !important;
}
.rct-series .rct-point[data-focus], .rct-point[data-unfocus] {
    stroke: var(--rct-focus-stroke) !important;
    stroke-width: var(--rct-focus-stroke-width) !important;
    filter: brightness(115%) !important;
    opacity: 1 !important;
}
.rct-point-labels {
    opacity: inherit;
    transition-property: opacity;
    transition-duration: 0.7s;
}
.rct-point-labels[data-unfocus] {
    opacity: 0.3 !important;
}

/** rct-point 대신 여기에 지정해야 outline에 반영된다. */
.rct-point-labels {
    font-size: var(--rct-point-label-font-size);
    font-weight: var(--rct-point-label-font-weight);
    stroke: var(--rct-point-label-stroke);
    fill: var(--rct-point-label-fill);
}
.rct-point-label {
    fill-opacity: 1;
    opacity: 1;
}
.rct-point-label-lines {
    stroke: #585;
    fill: none;
}

/** bar series */
.rct-bar-series {
    fill-opacity: 1;
}

/** circlebar series */
.rct-circlebar-series .rct-point {
    stroke: white;
}

/** barrange series */
.rct-barrange-series {
    fill-opacity: 0.85;
}

/** line series */
.rct-line-series-line {
    stroke-width: 1px;
}
.rct-line-series .rct-point {
    stroke-dasharray: none;
}
.rct-line-series-flag {
    font-weight: bold;
    font-size: 0.9em;
}

/** area series */
.rct-area-series-area {
    fill-opacity: 0.5;
}
.rct-area-series-area[data-polar] {
    fill-opacity: 0.25;
}
.rct-area-series-area[data-simple] {
    fill-opacity: 0.05;
}
.rct-area-series .rct-area-series-area {
    stroke: none;
}

/** arearange series */
.rct-arearange-series-area {
    fill-opacity: 0.5;
}
.rct-arearange-series .rct-arearange-series-area {
    stroke: none;
}

/** bubble series */
.rct-bubble-series {
    fill-opacity: 0.75;
    stroke-width: 1px;
}

/** scatter series */
.rct-scatter-series {
    fill-opacity: 0.7;
}
.rct-scatter-series .rct-point[data-focus] {
    fill-opacity: 0.9;
}

/** boxplot series */
.rct-boxplot-series {
    stroke-width: 1;
}
.rct-boxplot-point-min {
    stroke: #333;
    stroke-width: 2;
}
.rct-boxplot-point-mid {
    stroke: #333;
    stroke-width: 2;
}
.rct-boxplot-point-max {
    stroke: #333;
    stroke-width: 2;
}
.rct-boxplot-point-stem {
    stroke: #333;
    stroke-dasharray: 2;
}
.rct-boxplot-series .rct-point[data-focus] .rct-boxplot-point-stem {
    stroke: black;
    stroke-dasharray: none;
    stroke-width: 2px;
}

/** candlestick series */
.rct-candlestick-series {
    stroke-width: 1;
    fill-opacity: 0.85;
}
.rct-candlestick-series .rct-point[data-focus] {
    fill-opacity: 0.5;
}
.rct-candlestick-series .rct-point[data-decline] {
    fill: #008;
    stroke: #008;
}
.rct-candlestick-point-border {
    stroke: #333;
}
.rct-candlestick-point-wick {
    stroke: #003;
}

/** ohlc series */
.rct-ohlc-series {
    stroke-width: 2;
}
.rct-ohlc-series .rct-point[data-decline] {
    stroke: #00f;
}
.rct-ohlc-series .rct-point[data-focus] .rct-ohlc-point-back {
    fill: #0088ff20 !important;
}
.rct-ohlc-point-back {
    stroke: none;
}

/** waterfall series */
.rct-waterfall-series {
    fill-opacity: 0.85;
}
.rct-waterfall-point-negative {
    fill: #dd5500;
    stroke: #dd5500;
}
.rct-waterfall-point-sum {
    fill: #0055cc;
    stroke: #0055cc;
}
.rct-waterfall-series-lines {
    stroke: #77f;
    stroke-width: 2;
    stroke-dasharray: 2;
}

/** errobar series */
.rct-errorbar-series .rct-point {
    stroke: #008;
    stroke-width: 2px;
}
.rct-errorbar-series .rct-point[data-focus] .rct-errorbar-point-back {
    fill: #0088ff20 !important;
}

/** lollipop series */
.rct-lollipop-series {
    stroke-width: 3px;
}
.rct-lollipop-point-marker {
    stroke: none;
}
.rct-lollipop-series .rct-point[data-focus] {
    stroke: var(--rct-focus-stroke);
    stroke-width: inherit;
}
.rct-lollipop-series .rct-point[data-focus] .rct-lollipop-point-marker {
    stroke: var(--rct-focus-stroke);
    stroke-width: var(--rct-focus-stroke-width);
}

/** dumbbell series */
.rct-dumbbell-series {
    stroke-width: 3px;
}
.rct-dumbbell-point-marker {
    stroke: none;
}
.rct-dumbbell-series .rct-point[data-focus] {
    stroke: var(--rct-focus-stroke);
    stroke-width: inherit;
}
.rct-dumbbell-series .rct-point[data-focus] .rct-dumbbell-point-marker {
    stroke: var(--rct-focus-stroke);
    stroke-width: var(--rct-focus-stroke-width);
}

/** equalizer series */
.rct-equalizer-series {
    fill-opacity: 0.9;
}
.rct-equalizer-series .rct-point[data-focus] {
    filter: brightness(120%);
}

/** histogram */
.rct-histogram-series .rct-point {
    stroke: white;
}

/** vector series */
.rct-vector-series {
    stroke-width: 2px;
}
.rct-vector-series .rct-point[data-focus] {
    stroke-width: 5px;
}

/** heatmpa series */
.rct-heatmap-series .rct-point {
    stroke: none;
}

/** treemap series */
.rct-treemap-series .rct-point {
    stroke: white;
}

/** pie series */
.rct-pie-series .rct-point {
    stroke: white;
}
.rct-pie-series-inner {
    font-size: 20px;
    fill: #557;
}

/** funnel series */
.rct-funnel-series .rct-point {
    stroke: white;
}
.rct-funnel-series .rct-point[data-focus] {
    stroke: black;
    stroke-width: 2px;
}

/** gauge */
.rct-gauge-pane {
    fill: none;
}

/** gauge group */
.rct-gauge-group {
    padding: 10px;
}

/** circle gauge */
.rct-circle-gauge-rim {
    fill: var(--rct-circle-gauge-rim-fill);
}
.rct-circle-gauge-inner {
    fill: var(--rct-circle-gauge-inner-fill);
}
.rct-circle-gauge-value {
    fill: #0098ff;
}
.rct-circle-gauge-value[data-stroked] {
    fill: none;
}
.rct-circle-gauge-label {
    font-size: 40px;
    fill: var(--rct-circle-gauge-label-fill);
    stroke: none;
}
.rct-circle-gauge-label[data-grouped] {
    font-size: 20px;
}
.rct-circle-gauge-pin {
    fill: white;
    stroke: #333;
    stroke-width: 3px;
}
.rct-circle-gauge-hand {
    fill: #333;
    stroke: none;
}

/** clock gauge */
.rct-clock-gauge-face {
    fill: var(--rct-clock-gauge-face-fill);
    stroke: none;
}
.rct-clock-gauge-rim {
    fill: var(--rct-clock-gauge-rim-fill);
    stroke: var(--rct-clock-gauge-rim-stroke);
}
.rct-clock-gauge-tick {
    stroke: var(--rct-clock-gauge-tick-stroke);
    stroke-width: 2px;
}
.rct-clock-gauge-minor-tick {
    stroke: var(--rct-clock-gauge-minor-tick-stroke);
    stroke-width: 1px;
}
.rct-clock-gauge-tick-label {
    stroke: none;
    fill: var(--rct-clock-gauge-tick-label-fill);
    font-size: 1em;
}
.rct-clock-gauge-pin {
    fill: white;
    stroke: #333;
    stroke-width: 3px;
}
.rct-clock-gauge-hour {
    fill: #333;
}
.rct-clock-gauge-minute {
    fill: #333;
}
.rct-clock-gauge-second {
    fill: #c00;
}
.rct-clock-gauge-label {
    fill: var(--rct-clock-gauge-label-fill);
}

/** gauge scale */
.rct-gauge-scale-line {
    stroke: var(--rct-gauge-scale-line);
    fill: none;
}
.rct-gauge-scale-ticks {
    stroke: #555;
    stroke: var(--rct-gauge-scale-tick);
}
.rct-gauge-scale-tick-labels {
    font-size: 0.85em;
    fill: var(--rct-gauge-scale-tick-labels-stroke);
}

/** linear gauge */
.rct-linear-gauge-background {
    fill: var(--rct-linear-gauge-background-fill);
}
.rct-linear-gauge-value {
    fill: var(--rct-linear-gauge-value-fill);
}
.rct-linear-gauge-band-tick-labels {
    font-size: 0.85em;
    fill: var(--rct-linear-gauge-band-tick-labels-stroke);
}

/** linear gauge group */
.rct-linear-gauge-group-label {
    fill: var(--rct-linear-gauge-group-label-fill);
    font-size: 1.5em;
}

/** bullet gauge */
.rct-bullet-gauge-background {
    fill: var(--rct-bullet-gauge-background-fill);
}
.rct-bullet-gauge-value {
    fill: var(--rct-bullet-gauge-value-fill);
}
.rct-bullet-gauge-target {
    fill: var(--rct-bullet-gauge-target-fill);
}
.rct-bullet-gauge-label {
    font-size: 1em;
    fill: var(--rct-bullet-gauge-label-fill);
}
.rct-bullet-gauge-scale-line {
    stroke: var(--rct-bullet-gauge-scale-line-stroke);
}
.rct-bullet-gauge-scale-ticks {
    stroke: var(--rct-bullet-gauge-scale-ticks-stroke);
}
.rct-bullet-gauge-scale-tick-labels {
    font-size: 0.9em;
    fill: var(--rct-bullet-gauge-scale-tick-labels-stroke);
}

/** bullet gauge group */
.rct-bullet-gauge-group {
    padding: 10px;
}
.rct-bullet-gauge-group-label {
    font-size: 1.5em;
}

/** tooltip */
.rct-tooltip {
    font-size: 0.8em;
    pointer-events: none;
    opacity: 0.9;
}
.rct-tooltip-back {
    fill: white;
}
.rct-tooltip-tail {
    fill: white;
}
.rct-tooltip-text {
    fill: #333;
    stroke: none;
}

/** annotation */
.rct-annotation-background {
    fill: none;
    stroke: none;
}
.rct-text-annotation {
    font-size: 20px;
    stroke: #333;
    stroke-width: 3px;
}

/** crosshair */
.rct-crosshair-line {
    fill: none;
    stroke-width: 1;
    stroke: #80808080;
}
.rct-crosshair-bar {
    stroke: none;
    fill: #4488cc18;
}
.rct-crosshair-flag {
    stroke: none;
    fill: #555;    
}
.rct-crosshair-flag-text {
    stroke: none;
    fill: #fff;    
}

/** zoom tracker */
.rct-zoom-tracker {
    fill: var(--rct-zoom-tracker-fill);
}

/** series navigator */
.rct-navigator .rct-axis-line {
    display: none;
}
.rct-navigator-back {
    fill: white;
    stroke: #f0f0f0;
}
.rct-navigator-mask {
    fill: #4488cc20;
    /* stroke: #ccc; */
}
.rct-navigator-handle {
    fill: var(--rct-navigator-handle-color);
    stroke: var(--rct-navigator-handle-color);
}
.rct-navigator-handle[data-select], .rct-navigator-handle:hover {
    fill: var(--rct-navigator-handle-hover-color);
    stroke: var(--rct-navigator-handle-hover-color);
}

.rct-navigator-track {
    fill: var(--rct-navigator-track-fill);
    stroke: var(--rct-navigator-track-fill);
}
.rct-navigator-thumb {
    fill: var(--rct-navigator-thumb-fill);
    stroke: var(--rct-navigator-thumb-fill);
}

# Style 및 꾸미기


## 기본 코드

``` html
<html>
<head>
    <title>Home</title>
    <link href="./realchart-style.css" rel="stylesheet">
    <script type="text/javascript" src="./realchart-lic.js"></script>
    <script type="text/javascript" src="./realchart.0.9.43.min.js"></script>
</head>
<body>
    <div id="chart" style="width: 800px; height: 500px;">
    </div>
    <script>
        const config = {
            series: {
                data: [5, 7, 12, 16, 10, 8, 11, 8.5],
            },
        };
        RealChart.createChart(document, 'chart', config);
    </script>
</body>
</html>
```

