    stroke: var(--color-5);
}
.rct-series[data-index="5"] {
    fill: var(--color-6);
    stroke: var(--color-6);
}
.rct-series[data-index="6"] {
    fill: var(--color-7);
    stroke: var(--color-7);
}
.rct-series[data-index="7"] {
    fill: var(--color-8);
