}

/** bullet gauge group */
.rct-bullet-gauge-group {
    padding: 10px;
}
.rct-bullet-gauge-group-label {
    font-size: 1.5em;
}

/** tooltip */
.rct-tooltip {
    font-size: 0.8em;
    pointer-events: none;
    opacity: 0.9;
}
.rct-tooltip-back {
    fill: white;
}
.rct-tooltip-tail {
    fill: white;
}
.rct-tooltip-text {
    fill: #333;
    stroke: none;
}

/** annotation */
.rct-annotation-background {
    fill: none;
    stroke: none;
}
.rct-text-annotation {
    font-size: 20px;
    stroke: #333;
    stroke-width: 3px;
}

/** crosshair */
.rct-crosshair-line {
    fill: none;
    stroke-width: 1;
    stroke: #80808080;
}
.rct-crosshair-bar {
    stroke: none;
    fill: #4488cc18;
}
.rct-crosshair-flag {
    stroke: none;
    fill: #555;    
}
.rct-crosshair-flag-text {
    stroke: none;
    fill: #fff;    
}

/** zoom tracker */
.rct-zoom-tracker {
    fill: var(--rct-zoom-tracker-fill);
}

/** series navigator */
.rct-navigator .rct-axis-line {
    display: none;
}
.rct-navigator-back {
    fill: white;
    stroke: #f0f0f0;
}
.rct-navigator-mask {
    fill: #4488cc20;
    /* stroke: #ccc; */
}
.rct-navigator-handle {
    fill: var(--rct-navigator-handle-color);
    stroke: var(--rct-navigator-handle-color);
}
.rct-navigator-handle[data-select], .rct-navigator-handle:hover {
    fill: var(--rct-navigator-handle-hover-color);
    stroke: var(--rct-navigator-handle-hover-color);
}

.rct-navigator-track {
    fill: var(--rct-navigator-track-fill);
    stroke: var(--rct-navigator-track-fill);
}
.rct-navigator-thumb {
    fill: var(--rct-navigator-thumb-fill);
    stroke: var(--rct-navigator-thumb-fill);
}

