    --rct-focus-stroke-width: 2px;
    --rct-text-fill: #333;

    --rct-title-fill: #333;
    --rct-subtitle-fill: #333;

    --rct-body-background-stroke: none;

    --rct-axis-title-fill: #333;
    --rct-axis-line-stroke: #aaa;
    --rct-axis-baseline-stroke: #333;
    --rct-axis-tick-stroke: #555;
    --rct-axis-label-fill: #555;
    --rct-axis-grid-line-stroke: #ddd;
    --rct-axis-grid-line-stroke-start: none;
    --rct-axis-grid-line-stroke-end: none;
    --rct-axis-grid-line-stroke-width: 1px;
    --rct-axis-scrollbar-track-fill: #fdfdfd;
    --rct-axis-scrollbar-track-stroke: #aaa;
    --rct-axis-scrollbar-thumb-fill: lightgray;
    --rct-axis-scrollbar-rx: 4px;

    --rct-legend-background: none;
	--rct-legend-background-stroke: none;
    --rct-legend-background-stroke: none;
    --rct-legend-fill: #333;
    --rct-legend-item-disabled: #aaa;
    --rct-legend-item-disabled-decoration: line-through;

    --rct-point-label-font-size: 0.8em;
    --rct-point-label-font-weight: bold;
    --rct-point-label-stroke: none;
    --rct-point-label-fill: #333;

    --rct-credits-fill: #777;

    /* polar */
    --rct-polar-xaxis-grid-line-stroke: #ccc;
    --rct-polar-yaxis-grid-line-stroke: #ccc;
    --rct-polar-axis-labels-fill: #555;

    /* linear gauge */
    --rct-linear-gauge-background-fill: #eee;
    --rct-linear-gauge-value-fill: green;
    --rct-linear-gauge-band-tick-labels-stroke: #333;
    --rct-linear-gauge-group-label-fill: #333;
    /** bullet gauge */
    --rct-bullet-gauge-background-fill: #eee;
    --rct-bullet-gauge-value-fill: #333;
    --rct-bullet-gauge-target-fill: #333;
    --rct-bullet-gauge-label-fill: #333;
    --rct-bullet-gauge-scale-line-stroke: #333;
    --rct-bullet-gauge-scale-ticks-stroke: #333;
    --rct-bullet-gauge-scale-tick-labels-stroke: #333;
    /* circle gauge */
    --rct-circle-gauge-rim-fill: #ededed;
    --rct-circle-gauge-inner-fill: none;
    --rct-circle-gauge-label-fill: #000;
    --rct-gauge-scale-line: #555;
    --rct-gauge-scale-tick: #555;
    --rct-gauge-scale-tick-labels-stroke: #333;
    /* clock gauge */
    --rct-clock-gauge-face-fill: white;
    --rct-clock-gauge-rim-fill: #eee;
    --rct-clock-gauge-rim-stroke: gray;
    --rct-clock-gauge-tick-stroke: #333;
    --rct-clock-gauge-minor-tick-stroke: #555;
    --rct-clock-gauge-tick-label-fill: #333;
    --rct-clock-gauge-label-fill: #aaa;
    /** zoom tracker */
    --rct-zoom-tracker-fill: #0044ff30;
    /** series navigator */
    --rct-navigator-handle-color: #0098ff; 
    --rct-navigator-handle-hover-color: #55c;
    --rct-navigator-track-fill: lightgray;
    --rct-navigator-thumb-fill:#0098ff;
}
.rct-root[data-theme='dark'] {
    --rct-focus-stroke: #ccc;
    --rct-text-fill: #fff;

    --rct-title-fill: #fff;
    --rct-subtitle-fill: #fff;

    --rct-body-background-stroke: none;

    --rct-axis-title-fill: #fff;
    --rct-axis-line-stroke: #fff;
    --rct-axis-baseline-stroke: #fff;
    --rct-axis-tick-stroke: #fff;
    --rct-axis-label-fill: #fff;
    --rct-axis-grid-line-stroke: #fff;

    --rct-legend-background: none;
	--rct-legend-background-stroke: none;
    --rct-legend-fill: #fff;
    --rct-legend-item-disabled: #707070;
    --rct-legend-item-disabled-decoration: line-through;

    --rct-point-label-fill: #ddd;

    --rct-credits-fill: #999;

    /* polar */
    --rct-polar-xaxis-grid-line-stroke: #ccc;
    --rct-polar-yaxis-grid-line-stroke: #fff;
    --rct-polar-axis-labels-fill: #fff;

    /* linear gauge */
    --rct-linear-gauge-group-label-fill: #eee;
    /* circle gauge */
    --rct-circle-gauge-rim-fill: #515151;
    --rct-circle-gauge-label-fill: #fff;
    --rct-gauge-scale-line: #fff;
    --rct-gauge-scale-tick: #fff;
